import Button from "@material-ui/core/Button";
import { useState } from "react";
import { useHistory } from "react-router-dom";

function Menu({ setItemType }) {
  const history = useHistory();

  function handleBonsaiClick(e) {
    setItemType(e.target.value);
    history.push("/items");
  }

  return (
    <div className="menu">
      <div className="m-left">
        <>
          <Button
            variant="outlined"
            color="primary"
            onClick={(e) => history.push("/")}
          >
            Home
          </Button>
          <Button
            variant="outlined"
            color="primary"
            value="Plant"
            onClick={(e) => handleBonsaiClick(e)}
          >
            Bonsais
          </Button>
          <Button
            variant="outlined"
            color="primary"
            onClick={(e) => history.push("/supplies")}
          >
            Supplies
          </Button>
          <Button
            variant="outlined"
            color="primary"
            onClick={(e) => history.push("/cart")}
          >
            Cart
          </Button>
        </>
      </div>
    </div>
  );
}

export default Menu;
